import React from 'react'
import { useSelector } from 'react-redux'


const Confirmation = (props)=>{

    const bookedHistory = useSelector(state=>state.seats.info)

    return bookedHistory.map(item=>{
        return(
            <table>
            <tbody>
                <td>
                    {bookedHistory.name}
                </td>
                <td>
                    {bookedHistory.age}
                </td>
            </tbody>
        </table>
        )

    })
}
export default Confirmation;
